            "_id": 113056,
            "R": 5,
            "Name": "Massa Sem Luz",
            "Desc": "Fragmentos produzido da intensa batalha contra a Baleia Devoradora.<br>Mesmo no céu escuro da noite, existem sempre leves brilhos de luz, como pérolas brilhando através da areia, resquícios de diamante espalhado pelo asfalto, luzes que brilham através da neblina em uma noite enevoada e faíscas que acendem as chamas mais brilhantes.<br>Mas olhe com cuidado. As luzes gradualmente estão desaparecendo e a escuridão invadindo de todas as direções. Você se tornará um inferno incandescente, uma nova estrela queimando intensamente e iluminando o universo por um tempo. Ou, você se tornará o imperador da escuridão, que extermina todas essas faíscas insignificantes.",
