            "Desc": "Uma \"substância\" estranha obtida ao lutar contra a Baleia Devoradora. Seu peso é muito maior do que seria o esperado considerando seu tamanho.<br>Tudo se reúne em volta de objetos pesados, assim como ouro atrai mais do que ferro, ou o chão mais do que a brisa soprando acima. Assim como a luz não consegue escapar do vórtice da escuridão, causa e efeito está atrelada ao destino, talvez, de forma irreversível.<br>Mas a \"substância\" pesada em sua mão não parece real, como se fosse apenas uma sombra da presa da Baleia Devoradora. Talvez você apenas tenha lutado contra os ecos das profundezas do universo.",
