            "_id": 114052,
            "R": 5,
            "Name": "Eco de uma Corda Antiga",
            "Desc": "Material de Ascensão de Arma.<br>A grandiosa serenata do Deus Rei era composta por inúmeras sinfonias, mas a principal delas estava oculta em um lugar muito profundo, sob o destino conjunto da Nação da Água.<br>A harmonia e as sonatas da época de paz eram símbolos da civilização e da ordem, mas quando o próspero império degenerou em um feudo tirânico, os violentos romperam toda conexão com a fonte original e tentaram encobrir isso com uma magnífica capa dourada, resultando em um estrondo sem harmonia por todo o império...<br>Aquela primeira melodia do destino permaneceu inalterada e continuou a soar graças a uma partitura dourada que, com o passar do tempo, perdeu todo o seu brilho... até que tudo, absolutamente tudo se dissolveu e mergulhou novamente no caos.",
