            "Desc": "Material de Ascensão de Arma.<br>Uma peça enferrujada de uma harpa. O tubo por onde sai a música está obstruído, então ela não serve mais para tocar.<br>Dizem que, para restaurar a magnificência da antiga dinastia, os descendentes da serenata esquecida revestiram com ouro algumas harpas mecânicas de madeira em uma tentativa inútil de entregá-las aos golens taciturnos.<br>Muito tempo depois, essas harpas, agora enferrujadas e desafinadas, permanecem nas mãos daquelas gigantescas estátuas silenciosas enquanto acariciam o mar com o melancólico eco de sua música.",
