            "R": 3,
            "Name": "Brilho Remanescente do Poder Escaldante",
            "Desc": "Material de Ascensão de Armas.<br>O poder se trata de tecer milhares de pensamentos e controlar milhares de almas.<br>No entanto, o poder não é uma tirania implacável. Seu propósito é precisamente o mais profundo - criar um verdadeiro paraíso onde ninguém seja incomodado e não haja necessidade de perseguição e escravidão. <br>Como o rei silencioso viu no segredo do cristal, como o companheiro perdido ensinou uma vez. <br>O selo preto de inseto e o julgamento cor de ferro tornaram-se assim a pedra angular das leis do reino.",
