            "_id": 114045,
            "R": 2,
            "Name": "Eco do Poder Escaldante",
            "Desc": "Material de Ascensão de Armas.<br>Há muito, muito tempo atrás, o povo do Rei das Areias Amarelas esculpiram alguns selos reais imitando um besouro robusto para homenagear o sol carmesim que marca a ciclo do dia e da noite e o tempo infinito.<br>Embora o nome do rei não seja mais mencionado agora, esses pequenos selos reais continuam bem preservados, revelando o prestígio do seu passado.<br>Eles estão espalhados por todos os cantos com seus descendentes dourados, contando silenciosamente o passado do velho dono.",
