            "Desc": "Material de Ascensão de Armas.<br>Mais tarde, a dona das vegetações ensinou às pessoas como forjar ferro preto, e desta forma, os mortais ingênuos aprenderam como usar fogo e lâminas afiadas.<br>A Dona da Grama tinham muito prazer em ver isso. Mesmo que o fogo e o metal pudessem acabar machucando-a, eles também podiam tornar os mortais mais fortes.",
